import React, { useState, useEffect } from 'react';
import { Modal, Button, Form } from 'react-bootstrap';
import "../../RecipeModal.css";

function RecipeModal({ show, onHide, onSave, initialData = {} }) {
    const [title, setTitle] = useState('');
    const [ingredients, setIngredients] = useState('');
    const [description, setDescription] = useState('');
    const [photo, setPhoto] = useState('');

    useEffect(() => {
        if (show) {
            setTitle(initialData.title || '');
            setIngredients(initialData.ingredients || '');
            setDescription(initialData.description || '');
            setPhoto(initialData.photo || '');
        }
    }, [show, initialData]);

    const handleSave = (e) => {
        e.preventDefault();
        const recipeData = { title, ingredients, description, photo };
        onSave(recipeData);
        setTitle('');
        setIngredients('');
        setDescription('');
        setPhoto('');
        onHide();
    };

    return (
        <Modal show={show} onHide={onHide} centered>
            <Modal.Header closeButton className="recipe-modal__header">
                <Modal.Title className="recipe-modal__title">
                    {initialData.id ? 'Edit Recipe' : 'Add Recipe'}
                </Modal.Title>
            </Modal.Header>
            <Modal.Body className="recipe-modal__body">
                <Form onSubmit={handleSave}>
                    {initialData.photo && <img src={initialData.photo} alt="Recipe" className="recipe-modal__image" />}
                    <Form.Group className="mb-3">
                        <Form.Label>Title</Form.Label>
                        <Form.Control 
                            type="text" 
                            value={title} 
                            onChange={(e) => setTitle(e.target.value)} 
                            required
                        />
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label>Ingredients</Form.Label>
                        <Form.Control 
                            as="textarea" 
                            rows={3} 
                            value={ingredients} 
                            onChange={(e) => setIngredients(e.target.value)} 
                            required
                        />
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label>Description</Form.Label>
                        <Form.Control 
                            as="textarea" 
                            rows={3} 
                            value={description} 
                            onChange={(e) => setDescription(e.target.value)} 
                            required
                        />
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label>Photo URL</Form.Label>
                        <Form.Control 
                            type="text" 
                            value={photo} 
                            onChange={(e) => setPhoto(e.target.value)} 
                            required
                        />
                    </Form.Group>
                </Form>
            </Modal.Body>
            <Modal.Footer className="recipe-modal__footer">
                <Button variant="secondary" onClick={onHide} className="cancel">Cancel</Button>
                <Button variant="primary" type="submit" className="primary">
                    Save Recipe
                </Button>
            </Modal.Footer>
        </Modal>
    );
}

export default RecipeModal;
